import React, { Component } from 'react';
import './login.css'

const Flag = false;
class App extends Component {

    constructor(props){
        super()
    }



  render() {
    return (
         <div className="login-page">
        <div className="form registered ">
            <form  className="register-form">
                <input type="text" name="name" id="name" placeholder="user name"/>
                <input type="text" name="password" id="name" placeholder="password"/>
                <input type="email" name="name" id="name" placeholder="email id"/>
                <input type="button" value="Button" className="btn"/>
                <p className="msg" >Already Registere? <a href="#">Login</a></p>
            </form>
            <form action="" method="get" className="login-form">
                <input type="text" name="name" id="name" placeholder="user name"/>
                <input type="text" name="password" id="name" placeholder="password"/>
                <input type="button" value="LOGIN" className="btn"/>
                <p className="msg">Not Registered? <a href="#">Register</a></p>
            </form> 
        </div>
        </div>

    );
  }
}

export default App;
